import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart to enable quantity updates
    // The JS populates the product grid on load. We'll click the first available 'Add to Cart' button.
    const addToCartButton = page.locator('button.add-to-cart').first();
    await addToCartButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToCartButton.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    // The cart element is a div with class 'cart'
    const cartIcon = page.locator('div.cart');
    await cartIcon.waitFor({ state: 'visible', timeout: 5000 });
    await cartIcon.click();

    // Wait for the cart modal to be visible
    await page.waitForSelector('.cart-item', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // 3. Find and click the increase quantity button (+)
    // The JS generates '+' and '-' buttons with the class 'quantity-btn'
    const increaseQtyButton = page.locator('.cart-item-quantity button').filter({ hasText: '+' });
    await increaseQtyButton.waitFor({ state: 'visible', timeout: 5000 });
    await increaseQtyButton.click();

    // 4. Take a screenshot after updating the quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // 5. Extract the new quantity to verify the update
    const quantitySpan = page.locator('span.quantity');
    await quantitySpan.waitFor({ state: 'visible', timeout: 5000 });
    const newQuantity = await quantitySpan.textContent();

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2.",
      extractedData: {
        updatedQuantity: newQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
